import "./Roulette.sol";

contract Profile is Roulette{

    uint256 price = 1 * (1 ether);
    address myContract = address(this);

    function someEther() public payable returns(bool){
        require(msg.value == price, "non sono stati versati abbastanza fondi");

        
        return true;
    }


    function getStato() public view returns(uint, uint ){
        
        return (address(this).balance / 1 ether, price);

    }

    function cashOut() public {
    address payable player = payable(msg.sender); 

    //Array di giocatori vincenti
    //uint256 amount = winnings[player];
    //require(amount > 0);
    //require(amount <= address(this).balance);
    //winnings[player] = 0;
    player.transfer(1 ether);
  }


}
